import React from "react";
import championServices from "../.././services/champions";

const skinImgUrl =
  "https://ddragon.leagueoflegends.com/cdn/img/champion/splash/";
export default function Champion({ data, clickHandler }) {
  return (
    <div
      className="card"
      onClick={() =>
        clickHandler(data[1].id, championServices.capitalize(data[1].title))
      }
    >
      <h1>{data[1].id}</h1>
      <p>{championServices.capitalize(data[1].title)}</p>
      <img src={`${skinImgUrl}${data[1].id}_0.jpg`} alt={data[1].id} />
    </div>
  );
}
